public struct ExecutionOutcomeView: Codable {
    /// Receipt IDs generated by this transaction or receipt.
    public let receipt_ids: [CryptoHash]
    /// The amount of the gas burnt by the given transaction or receipt.
    public let gas_burnt: String
    /// Execution status. Contains the result in case of successful execution.
    public let status: String
    /// The amount of tokens burnt corresponding to the burnt gas amount.
    /// This value doesn't always equal to the `gas_burnt` multiplied by the gas price, because
    /// the prepaid gas price might be lower than the actual gas price and it creates a deficit.
    /// `tokens_burnt` also contains the penalty subtracted from refunds, while
    /// `gas_burnt` only contains the gas that we actually burn for the execution.
    public let tokens_burnt: String
    /// The id of the account on which the execution happens. For transaction this is signer_id,
    /// for receipt this is receiver_id.
    public let executor_id: String
    /// Logs from this transaction or receipt.
    public let logs: [String]
    /// Execution metadata, versioned
    public let metadata: String?

    public init(receipt_ids: [CryptoHash], gas_burnt: String, status: String, tokens_burnt: String, executor_id: String, logs: [String], metadata: String?) {
        self.receipt_ids = receipt_ids
        self.gas_burnt = gas_burnt
        self.status = status
        self.tokens_burnt = tokens_burnt
        self.executor_id = executor_id
        self.logs = logs
        self.metadata = metadata
    }
}

